    async def antimentioncmd(self, message):
        """–í–∫–ª—é—á–∏—Ç—å/–≤—ã–∫–ª—é—á–∏—Ç—å —Ä–µ–∂–∏–º AntiMention. –ò—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ: .antimention <clearall* (–ø–æ –∂–µ–ª–∞–Ω–∏—é)>.\n* - –≤—ã–∫–ª—é—á–∞–µ—Ç —Ä–µ–∂–∏–º –≤–æ –≤—Å–µ—Ö —á–∞—Ç–∞—Ö."""
        am = self.db.get("AntiMention", "am", [])
        ac = self.db.get("AntiMention", "action", {})
        args = utils.get_args_raw(message)
        nk = "cco"
        mm = "te"
        if args == "clearall":
            self.db.set("AntiMention", "am", [])
            self.db.set("AntiMention", "action", {})
            return await message.edit("<b>[AntiMention]</b> –†–µ–∂–∏–º –≤—ã–∫–ª—é—á–µ–Ω –≤–æ –≤—Å–µ—Ö —á–∞—Ç–∞—Ö.")
        if not message.is_private:
            chat = await message.get_chat() 
            if not chat.admin_rights and not chat.creator:
                return await message.edit("<b>–Ø –Ω–µ –∞–¥–º–∏–Ω –∑–¥–µ—Å—å.</b>")
            else:
                if chat.admin_rights.delete_messages == False:
                    return await message.edit("<b>–£ –º–µ–Ω—è –Ω–µ—Ç –Ω—É–∂–Ω—ã—Ö –ø—Ä–∞–≤.</b>") 
            chatid = str(message.chat_id)
            if chatid in am:
                am.remove(chatid)
                ac.pop(chatid)
                self.db.set("AntiMention", "am", am)
                self.db.set("AntiMention", "action", ac)
