        """–î–æ–±–∞–≤–∏—Ç—å –∏—Å–∫–ª—é—á–µ–Ω–∏—è/–ø–æ—Å–º–æ—Ç—Ä–µ—Ç—å —Å–ø–∏—Å–æ–∫ –∏—Å–∫–ª—é—á–µ–Ω–∏–π. –ò—Å–ø–æ–ª—å–∑—É–π: .amex <@ –∏–ª–∏ —Ä–µ–ø–ª–∞–π> –∏–ª–∏ <clear>."""
